import React, { Component } from 'react'

export default class Episodes extends Component {
    componentDidMount(){
        this.props.getAllEpisodes();
    }
    render() {
        return (
            <div className="episodes">
               <h1>Episodes</h1>
               {this.props.episodes.map(episode=>(
                <div class="card">
                   <p>{episode.results.name}</p>
                </div>
               ))}
              
            </div>
        )
    }
}
